    return (
        <div>
            <Header/>
            <Switch>
                <Route path='/about/' component={About} exact />
                <Route path='/create/' component={Create} exact />
                <Route path='/home/' component={Home} exact />
                <Route path='/login/' component={Login} exact />


            </Switch>
        </div>
    );
};

export default App;
